import { Component } from '@angular/core';

@Component({
  selector: 'app-logo',
  templateUrl: './logo.component.html',
  styleUrls: ['./logo.component.css']
})
export class LogoComponent {

}
<div class="logo transition-transform duration-1000 mt-12x flex justify-center items-center w-full h-full">
    <a [routerLink]="['/home']">
        <video class="max-w-full max-h-full" autoplay muted>
            <source src="../../../assets/imagenes/logo.mp4" type="video/mp4">
        </video>    
    </a>
</div>
